/* eslint-disable jsx-a11y/accessible-emoji */
import React from "react";
import "../css/Footer.css";
import { FaBeer } from 'react-icons/fa';


export const Footer = () => (
    <div className="footer">
        <h3><a href="https://github.com/codingwithkat"><i className="fab fa-github"></i></a>  <a href="https://www.linkedin.com/in/katerina-papaloukas/"><i className="fab fa-linkedin"></i></a></h3>
        <p className="copyright">© 2020 Katerina Papaloukas <span> 👩🏻‍💻</span> </p>
        <p>Powered by: <FaBeer /></p>
    </div>
);
